  true,\n\t\"url\": null,\n\t\"notes\": \"<p>MACStats includes state-specific information
  about program enrollment, spending, eligibility levels, optional Medicaid benefits
  covered, and the federal medical assistance percentage (FMAP), as well as an overview
  of cost-sharing permitted under Medicaid and the dollar amounts of common federal
  poverty levels (FPLs) used to determine eligibility for Medicaid and CHIP. It also
  provides information that places these programs in the broader context of state
  budgets and national health expenditures.</p>n\",\n\t\"license_title\": \"Other
